import React, {useState, useCallback} from 'react';

import './VehiclePage.css';

const VehiclesPage = () => {
    const [vehicles, setVehicles] = useState([]);
    const [nextPageUrl, setNextPageUrl] = useState("https://swapi.dev/api/vehicles/");
    const [previousPageUrl, setPreviousPageUrl] = useState("https://swapi.dev/api/vehicles/");

    const handleVehicles = useCallback(async(url)=>{

        const response = await fetch(url);
          const data = await response.json();

          setNextPageUrl(data.next);
          setPreviousPageUrl(data.previous);
          setVehicles(data.results);
    },[]);

    const nextPageHandler = () => {
      if (nextPageUrl) {
        handleVehicles(nextPageUrl);
      }
    };
  
    const backPageHandler = () => {
      if (previousPageUrl) {
        handleVehicles(previousPageUrl);
      }
    };


  return (
    <div className='vehicle-container'>
      <h1>Vehicles Page</h1>
      <button onClick={backPageHandler} disabled={!previousPageUrl}>
        Back
      </button>
      <button onClick={nextPageHandler} disabled={!nextPageUrl}>
        Next
      </button>
      <h2>Table 1</h2>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Model</th>
            <th>Manufacturer</th>
            <th>Credit cost</th>
            <th>Length</th>
            <th>Max atmospheric speed</th>
          </tr>
        </thead>
      <tbody>
        {vehicles.map((result)=>(
            <tr key={result.url}>
                <td>{result.name}</td>
                <td>{result.model}</td>
                <td>{result.manufacturer}</td>
                <td>{result.cost_in_credits}</td>
                <td>{result.legnth}</td>
                <td>{result.max_atmosphering_speed}</td>
            </tr>
        ))}
        </tbody>
        </table>
        <h2>Table 2</h2>
        <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Crew</th>
            <th>Passengers</th>
            <th>Cargo capacity</th>
            <th>Consumables</th>
            <th>Vehicle class</th>
          </tr>
        </thead>
      <tbody>
        {vehicles.map((result)=>(
            <tr key={result.url}>
                <td>{result.name}</td>
                <td>{result.model}</td>
                <td>{result.manufacturer}</td>
                <td>{result.cost_in_credits}</td>
                <td>{result.legnth}</td>
                <td>{result.max_atmosphering_speed}</td>
            </tr>
        ))}
        </tbody>
        </table>
      <button onClick={backPageHandler} disabled={!previousPageUrl}>
        Back
      </button>
      <button onClick={nextPageHandler} disabled={!nextPageUrl}>
        Next
      </button>
    </div>
  );
};

export default VehiclesPage;
